import React, { Component } from 'react';
import Navbar from './NavBar';
import Destiny2 from './Images/Destiny2.png';
import Logo from './Images/Icon.png';
import AboutBlur from './AboutBlur';
import './About.css';


class About extends Component{
    constructor(props){
    super(props) 
    this.state = {
        title: "Destiny Jones",
        subtitle: "Full Stack Developer"
    }
}

render(){
    return (
        <div>
            <Navbar />
            <div className='Header'>
                <div className='HomeContent'>
                        <div className="Home-HeaderContent">
                            <div id="NavLogo-mini">
                                <img id="CodeDestinee-mini" src={Logo} alt="Logo" />
                                <h3 id="LogoName-mini">Code <br/> Destinee</h3>
                            </div>
                            <h1 className='Home-title' style={{"marginLeft": "110px"}}>{this.state.title}</h1>
                            <h6 className='Home-subtitle' style={{"width": "250px"}}><strong>{this.state.subtitle}</strong></h6>
                        </div>
                        <img id='DestinyJ2' src={Destiny2} alt='Destiny Jones' />
                </div>
            </div>
            <div className='Home-BottomContent'>
            <p>The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters,
               as opposed to using 'Content here, content here', making it look like readable English. Many 
               desktop publishing packages and web page editors now use Lorem Ipsum as their default model text,
               and a search for 'lorem ipsum' will uncover many web sites still in their infancy. Various versions 
               have evolved over the years, sometimes by accident, sometimes on purpose.</p>
              <AboutBlur />
            </div>
        </div>
    )
}
}

export default About
